                                <div>
                                    <PersistentDrawerLeft />
                                </div>
                                <div style={{ display: "flex", justifyContent: "space-between" }}>
                                    <div id="keepImage">
                                        <img src={require('/home/bridgeit/Shweta/fundooNotes/frontend/src/assets/images/keep.png')} alt="keep icon" />
