                                            </Tooltip>
                                        </IconButton>
                                    </div>

                                    <div>
                                        <IconButton>
                                            <Tooltip title="Notifications" style={{ width: "25px" }} >
                                                <img src={require('/home/bridgeit/Shweta/fundooNotes/frontend/src/assets/images/notify.jpg')} alt="refresh icon" />
