                        </div>
                    </Toolbar>
                </div>
                {/* <DrawerMenu
                    appBarProps={this.state.open}
                    handleNavigation={this.props.handleNavigation}
                    searchLabels={(value) => this.searchLabels(value)}
                    makeLabelFalse={this.props.makeLabelFalse} /> */}
            </AppBar>
            </div>
            // </MuiThemeProvider>  
        )
    }
}
export default DashboardComponent;
